import React, { Component } from 'react';
import { Container, Image } from 'react-bootstrap';


class UserProfile extends Component {

	render() {
		return (
			<Container>
				<div style={{
					display: "flex",
					justifyContent: "center",
					alignItems: "center"
				}}>
					<hr
						style={{
							color: 'blue',
							backgroundColor: 'red',
							height: 5
						}}
					/>
					<Image src="/Images/users/1.jpg" roundedCircle alt="" style={{ width: '250px' }} />
				</div>
			</Container>
		);
	}
}

export default UserProfile;
